import React from 'react';
import './searchPanel.css'

const SearchPanel = ()=>{
const searchText = 'Type to search'
const searchStyle = {
  fontSize: '25px'
}
  return(
    <input
    className='search-input'
    style = {searchStyle}
    placeholder={searchText}/>
  );
};
export default SearchPanel
